    <g id="Resting_View">
        <rect class="st0" width="1366" height="118.1"/>
        <rect x="148" y="29.2" class="st1" width="1137.5" height="88.9"/>
        <text transform="matrix(1 0 0 1 147.958 49.0814)"><tspan x="0" y="0" class="st2 st3 st4">DNA makes RNA, RNA makes proteins, proteins create the structure and function for </tspan><tspan x="0" y="36" class="st2 st3 st4">every cell in the human body. These proteins are made entirely of amino acids.</tspan><tspan x="768" y="36" class="st2 st3 st5"> </tspan><tspan x="774.4" y="36" class="st2 st6 st5"> </tspan><tspan x="0" y="64.8" class="st2 st6 st7">     </tspan></text>
        <rect x="148" y="216.3" class="st1" width="308.3" height="142.7"/>
        <text style="small-screen-left-text" transform="matrix(1 0 0 1 147.9583 234.7552)"><tspan x="0" y="0" class="st6 st8">Proteins Regulate:  </tspan><tspan x="0" y="21" class="st6 st9">Every cell’s DNA, turning genes on and off. </tspan><tspan x="0" y="42" class="st6 st9">Proteins are involved in every chemical reaction in </tspan><tspan x="0" y="66" class="st6 st9">the cell, including turing food into fuel.</tspan><tspan x="178.5" y="66" class="st6 st10"> </tspan><tspan x="182.3" y="66" class="st6 st11"> </tspan></text>
        <rect x="148" y="369.1" class="st1" width="308.3" height="197.9"/>
        <text style="small-screen-left-text" transform="matrix(1 0 0 1 147.9583 387.5843)"><tspan x="0" y="0" class="st6 st8">Proteins Facilitate: </tspan><tspan x="0" y="21" class="st6 st9">Cellular division, transformation, growth, signaling, </tspan><tspan x="0" y="42" class="st6 st9">transporting molecules, hormones, metabolism, </tspan><tspan x="0" y="63" class="st6 st9">waste disposal, a healthy immune system, working </tspan><tspan x="0" y="84" class="st6 st9">organs, hair growth, cellular communication, and </tspan><tspan x="0" y="105" class="st6 st9">protection. </tspan><tspan x="0" y="129" class="st6 st9">Properly functioning proteins define life.</tspan><tspan x="235.2" y="129" class="st6 st10"> </tspan><tspan x="239" y="129" class="st6 st11"> </tspan></text>
        <rect x="148" y="589.2" class="st1" width="310.3" height="147.9"/>
        <text style="small-screen-left-text" transform="matrix(1 0 0 1 147.9583 607.6747)"><tspan x="0" y="0" class="st6 st8">Proteins Provide Structure: </tspan><tspan x="0" y="21" class="st6 st9">Cell’s are made of proteins specified by DNA. </tspan><tspan x="0" y="42" class="st6 st9">Your body has around 37 trillion cells that define </tspan><tspan x="0" y="63.6" class="st6 st9">human existence.</tspan><tspan x="102.6" y="63.6" class="st6 st10">   </tspan></text>

        <text transform="matrix(1 0 0 1 704.3247 54.3712)"><tspan x="0" y="0" class="st12 st13">Neurotransmitters</tspan><tspan x="98.6" y="0" class="st6 st13"> are either:</tspan><tspan x="0" y="18" class="st6 st13">• Made of Amino acids</tspan><tspan x="0" y="36" class="st6 st13">• Are Amino acids</tspan><tspan x="0" y="54" class="st6 st13">• Or Partly made of </tspan><tspan x="0" y="72" class="st6 st13">Amino acids </tspan></text>
